import React, { useState } from 'react';
import { 
  Box, 
  Card, 
  CardContent, 
  TextField, 
  Button, 
  Typography, 
  Alert,
  CircularProgress,
  Paper,
  Link as MuiLink
} from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Register: React.FC = () => {
  const navigate = useNavigate();
  const { login } = useAuth();
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
    cardholderId: ''
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError(null);

    // Validate form data
    if (!formData.username || !formData.email || !formData.password || !formData.cardholderId) {
      setError('All fields are required');
      return;
    }

    if (formData.password !== formData.confirmPassword) {
      setError('Passwords do not match');
      return;
    }

    if (!formData.cardholderId.startsWith('ich_')) {
      setError('Cardholder ID must start with "ich_"');
      return;
    }

    try {
      setLoading(true);

      // Check if the cardholder ID is already registered
      const storedUsers = localStorage.getItem('registeredUsers');
      const usersList = storedUsers ? JSON.parse(storedUsers) : [];

      // Check if cardholder ID is already in use
      const existingCardholderUser = usersList.find(
        (user: any) => user.cardholderId === formData.cardholderId
      );

      if (existingCardholderUser) {
        setError('This Cardholder ID is already registered with another account');
        setLoading(false);
        return;
      }

      // Check if email is already in use
      const existingEmailUser = usersList.find(
        (user: any) => user.email === formData.email
      );

      if (existingEmailUser) {
        setError('This email address is already registered');
        setLoading(false);
        return;
      }

      // Create user object
      const newUser = {
        id: `user_${Date.now()}`,
        username: formData.username,
        email: formData.email,
        password: formData.password,
        cardholderId: formData.cardholderId,
        name: formData.username,
        createdAt: new Date().toISOString()
      };

      // Store registered users in localStorage
      usersList.push(newUser);
      localStorage.setItem('registeredUsers', JSON.stringify(usersList));

      // Auto-login after registration
      await login(formData.email, formData.password);

      // Navigate to dashboard
      navigate('/');
    } catch (error: any) {
      setError(error.message || 'Registration failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: 'calc(100vh - 64px)', // Adjust for AppBar
        padding: 2,
        backgroundColor: 'background.default'
      }}
    >
      <Paper elevation={3} sx={{ maxWidth: 500, width: '100%' }}>
        <Card>
          <CardContent sx={{ p: 4 }}>
            <Box sx={{ textAlign: 'center', mb: 4 }}>
              <Typography variant="h4" component="h1" gutterBottom>
                Create Account
              </Typography>
              <Typography variant="body1" color="text.secondary">
                Register to manage your virtual cards
              </Typography>
            </Box>

            {error && (
              <Alert severity="error" sx={{ mb: 3 }}>
                {error}
              </Alert>
            )}

            <form onSubmit={handleSubmit}>
              <TextField
                label="Username"
                name="username"
                value={formData.username}
                onChange={handleChange}
                fullWidth
                margin="normal"
                required
                disabled={loading}
              />
              <TextField
                label="Email"
                name="email"
                type="email"
                value={formData.email}
                onChange={handleChange}
                fullWidth
                margin="normal"
                required
                disabled={loading}
              />
              <TextField
                label="Password"
                name="password"
                type="password"
                value={formData.password}
                onChange={handleChange}
                fullWidth
                margin="normal"
                required
                disabled={loading}
              />
              <TextField
                label="Confirm Password"
                name="confirmPassword"
                type="password"
                value={formData.confirmPassword}
                onChange={handleChange}
                fullWidth
                margin="normal"
                required
                disabled={loading}
              />
              <TextField
                label="Cardholder ID"
                name="cardholderId"
                value={formData.cardholderId}
                onChange={handleChange}
                placeholder="ich_xxxxxxxxxxxxxxxx"
                helperText="Enter your Stripe Cardholder ID (starts with 'ich_')"
                fullWidth
                margin="normal"
                required
                disabled={loading}
              />
              <Button
                type="submit"
                variant="contained"
                fullWidth
                size="large"
                disabled={loading}
                sx={{ mt: 3 }}
              >
                {loading ? <CircularProgress size={24} /> : 'Register'}
              </Button>
            </form>

            <Box sx={{ mt: 3, textAlign: 'center' }}>
              <Typography variant="body2">
                Already have an account?{' '}
                <MuiLink component={Link} to="/login">
                  Sign in
                </MuiLink>
              </Typography>
            </Box>
          </CardContent>
        </Card>
      </Paper>
    </Box>
  );
};

export default Register;
